export default function Rating(props) {
    const starPink = Array.from({length: props.rating}, () => <StarPink/>);
    const starGrey = Array.from({length: 5 - props.rating}, () => <StarGrey />);

    const test = [{length: props.rating}]
    console.log(test)
    return (
        <div className="rating">
            {starPink.map((star, index) => (
                <div style={{width: '10%'}} key={index}>{star}</div>
            ))}
            {starGrey.map((star, index) => (
                <div key={index}>{star}</div>
            ))}
        </div>
    )
}
